import React from 'react'
import {Link,useRouteMatch} from 'react-router-dom'
import { useComics } from '../../hooks'
import { Comic } from '../../hooks/Comic'

function Master(){
  const comics:Comic[] = useComics()
  const { url } = useRouteMatch();

  // if(!!comics.length) return <span>No Results!</span>
  return (
    <ul>
      {comics.map(comic => <li><Link key={comic.id} to={`${url}/${comic.id}`}>{comic.title}</Link>)</li>)}
    </ul>
  )


}

export default Master
